import React from "react";
import { Box, Typography } from "@mui/material";

const style = {
  fontSize: 20,
  marginBottom: 15,
};

const TopList = () => {
  return (
    <Box width="50%">
      <Typography variant="h3" marginBottom={5}>
        Top 10 and worst 10
      </Typography>
    </Box>
  );
};

export default TopList;
